data.text:
@mariorguuez @isorarguez @Lorenaacostap1 @_leeiireeeee_ @carlamaffioli Comparar ambas situaciones no es correcto. Nosotros no vivimos esa situacion porque no estabamos alli, no sabemos ni lo haremos nunca como de dificil fue convivir con un volcan.

Nuestra EBAU mantiene la adaptacion por el COVID y nadie se queja.

No seamos tan hipocritas.

@Noemi_delaCalle Nadie ha hablado de esos ciudadanos. 

Lo sorprendente es la juventud con la que se mete en las instituciones y no los estudios o no que tenga. 

Rectificar es de sabios 😉

@Noemi_delaCalle El clasismo de un hijo de madre soltera y trabajadora (sanitaria, por cierto) y que va a estudiar con la ayuda de una BECA en una universidad publica.

¿Ese clasismo? 

Hugo no tiene el titulo de bachillerato porque acaba de terminarlo, al igual que yo.

@hp_ayan @juanjaviersg @ppmadrid “Lo de Cifuentes” 

Respaldar el mejor resultado de tu partido en la Comunidad de Madrid en un caso que resulto toda una persecucion personal y politica sin justificacion.

Para eso ha quedado Ciudadanos. https://t.co/Rhy2rGQcjF

@Nandobustillo03 La expresion “plurinacional” no fue la acertada, esta claro. Espana es una unica nacion. 

Eso no significa que se tengan que negar las particularidades que presentan muchas de nuestras regiones. Que son estas: 

No hay mas. Ni plurinacional, ni complejo nacionalista, ni nada. https://t.co/pyXjrjidR9

@cristobalortga “Nacionalidad”

Negar la realidad te aleja de ella. 
Espana es un pais diverso y no hay ningun problema en afirmarlo. https://t.co/KtH7CWFhLc

@cristobalortga La expresion no fue la acertada pero el trasfondo es el mismo. 

Respeto a la unidad de Espana y su pluralidad, no hay mas. 
Ni complejos nacionalistas, ni leches.
